import React from 'react'

export const UserList = () => {
    const users = [
        {id:'1', name:'Inventory 1',code:'#ab123',type:'Stock',description:'This is user No.1'}
      ]

    const renderCard = () => users.map(user => (
        <div>
            <h3>{user.name}</h3>
            <span></span>
        </div>
    ))


  return (
    <div>
        {users.length ? renderCard():<p>No card</p>}
    </div>
  )
}
